Validation Errors Use Case: Invalid input data. HTTP Code: 400 Bad Request Response: { "error": { "code": 400, "message": "Invalid input data", "details": [ { "field": "email", "message": "Email is required" }, { "field": "password", "message": "Password is too short" } ] }
} Authentication Errors Use Case: Missing or invalid authentication credentials. HTTP Code: 401 Unauthorized for authentication issues. 403 Forbidden for permission issues. Response: { "error": { "code": 401, "message": "Authentication failed. Token is invalid or expired." }
} Resource Not Found Use Case: The requested resource does not exist. HTTP Code: 404 Not Found Response: { "error": { "code": 404, "message": "Resource not found: User with ID 123 does not exist." }
} Conflict Errors Use Case: State conflicts, such as duplicate data or resource locking. HTTP Code: 409 Conflict Response: { "error": { "code": 409, "message": "A user with this email address already exists." }
} Rate Limiting Use Case: Too many requests from a client. HTTP Code: 429 Too Many Requests Response: { "error": { "code": 429, "message": "Too many requests. Please try again later." }
} Internal Server Errors Use Case: Unexpected issues on the server. HTTP Code: 500 Internal Server Error Response: { "error": { "code": 500, "message": "An internal server error occurred. Please contact support." }
}

